import React from "react";
import { Link } from "react-router-dom";

import "./styles.css";
import { useState } from "react";
import { useRegister } from "./../../hooks/useRegister";

export default function Register() {
  const { registers, setRegisters } = useRegister();
  const [nome, setNome] = useState("");
  const [sexo, setSexo] = useState("");
  const [dataDeNascimento, setDataDeNascimento] = useState("");
  const [endereco, setEndereco] = useState("");
  const [cpf, setCpf] = useState("");
  const [whatsapp, setWhatsapp] = useState("");
  const [registerFullDataFirstPart, setRegisterFullDataFirstPart] = useState(
    ""
  );
  return (
    <>
      <div className="leftball" />
      <Link to="/">
        <button
          style={{
            width: "100px",
            marginLeft: "20px",
            fontSize: "20px",
            color: "black",
            fontFamily: "PMingLiU-ExtB",
            position: "absolute",
          }}
        >
          Voltar
        </button>
      </Link>
      <div className="registerContainer">
        <div className="formRegisterContainer">
          <div className="placeholderContainer">
            <div className="formPlaceholderContainer">
              <input
                className="placeholder"
                placeholder="Nome"
                onChange={(e) => setNome(e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="Sexo"
                onChange={(e) => setSexo(e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="Data de Nascimento"
                onChange={(e) => setDataDeNascimento(e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="Endereço"
                onChange={(e) => setEndereco(e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="CPF"
                onChange={(e) => setCpf(e.target.value)}
              ></input>
              <input
                className="placeholder"
                placeholder="Número de Whatsapp"
                onChange={(e) => setWhatsapp(e.target.value)}
              ></input>
              <Link to="/registersecondstep">
                <button
                  className="submit"
                  type="submit"
                  onClick={() =>
                    setRegisters(
                      nome + sexo + dataDeNascimento + endereco + cpf + whatsapp
                    )
                  }
                >
                  Próximo
                </button>
              </Link>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
